        console.log("Delete Error");
        res.json({ message: 'Failed to delete'});
      } else {
        console.log("Delete Success");
        res.json({ message: "Database cleared" });
      }
    });
  } catch (e) {
    res.json({ message: 'Something went wrong...' });
